const API_URL = 'http://127.0.0.1:5000';
export const uploadFile = (body: FormData) => fetch(`${API_URL}/uploadFile`, {
  method: 'POST',
  body,
  mode: 'no-cors',
}).then(res => { console.log('__!!!__ we are in response __!!!__');
                 console.log(res);
                 console.log(res.text());
                 res.text()}).catch(console.error);
